import './App.scss';

function App() {
  return (
    <div className="App">
      <nav className="navbar option">Option bar</nav>
      <nav className="navbar board">Board bar</nav>
      <nav className="workspace">
        <header>Brainstorm</header>
        <ul>
          <li>Add everything you want </li>
        </ul>
        <footer>Add another card</footer>
      </nav>
    </div>
  );
}

export default App;
